function f_gold(nums) {
    let m1 = -Infinity, m2 = -Infinity, m3 = -Infinity;
    for (let num of nums) {
        if ([m1, m2, m3].includes(num)) {
            continue;
        }
        if (num > m1) {
            [m1, m2, m3] = [num, m1, m2];
        } else if (num > m2) {
            [m2, m3] = [num, m2];
        } else if (num > m3) {
            m3 = num;
        }
    }
    return m3 !== -Infinity ? m3 : m1;
}
